import React from 'react';

class Home extends React.Component{
  renderPanels(title){
    return(
      <div className="four wide column">
        {title}
      </div>
    );
  }

  render(){
    return(
      <div class="ui grid">
        {this.renderPanels('hello')}
        {this.renderPanels('hello')}
        {this.renderPanels()}
      </div>
    );
  };
}

export default Home;
